import React from 'react'
import './itemlist.css'

const ListItem = (props) => {
  const {
    id,
    task,
    onClickDelete
  } = props
  return (
    <div className="list-item">
      <div className="list-item-content">
        <li> 
          {task} 
        </li>

        <button 
          className="delete-button" 
          onClick={() => onClickDelete(id)}
        > Delete </button>
        </div>
    </div>
  )
}

export default ListItem
